import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Tablet = createReactComponent("Tablet", ["svg", defaultAttributes, [["rect", {
  x: "4",
  y: "2",
  width: "16",
  height: "20",
  rx: "2",
  ry: "2",
  key: "1p0e78"
}], ["line", {
  x1: "12",
  y1: "18",
  x2: "12.01",
  y2: "18",
  key: "rbtten"
}]]]);
export default Tablet;
